var calcFoodScore = function(num){
	var foodScore;
	if (num==0) {
		foodScore = 0;
	}
	if(num>0 && num<=10){
		foodScore = 2;
	}
	if(num>10 && num<=20){
		foodScore = 4;
	}
	if(num>20 && num<=30){
		foodScore = 6;
	}
	if(num>30 && num<=40){
		foodScore = 8;
	}
	if(num>40){
		foodScore = 10;
	}
	return foodScore;
};

